import { Breadcrumb } from "react-bootstrap";

function Crumbs() {
  return (
    <Breadcrumb>
      <Breadcrumb.Item href="#">Home</Breadcrumb.Item>
      <Breadcrumb.Item href="#">About</Breadcrumb.Item>
      <Breadcrumb.Item href="#">Financial Planning</Breadcrumb.Item>
      <Breadcrumb.Item href="#">Investment Planning</Breadcrumb.Item>
      <Breadcrumb.Item href="#">Insurance</Breadcrumb.Item>
      <Breadcrumb.Item href="#">Blog</Breadcrumb.Item>
      <Breadcrumb.Item href="#">Contact Us</Breadcrumb.Item>
    </Breadcrumb>
  );
}

export default Crumbs;
